import React from 'react';
import MigoLandingPage from './MigoLandingPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<MigoLandingPage />} />
        <Route path="/privacy-policy" element={<PrivacyPolicy />} />
        <Route path="/terms-of-use" element={<TermsOfUse />} />
      </Routes>
    </Router>
  );
}

export default App;
